import React from 'react'




export default class DogInfo extends React.Component {

    render(){
        return (
            <div id="dog-bar">
                {this.props.dogs.map(dog => <Dog name={dog.name} image={dog.image} goodDog={dog.isGoodDog} />)}            
              </div>
        )
    }
}
